import React from "react";

function Sort({sortName, icon, setSort}) {
  return (
    <div>
      <button
        type="button"
        name={sortName}
        aria-label={sortName + "Button"}
        onClick={setSort}
        className={`fa fa-sort-${icon}-asc`}
      ></button>
    </div>
  );
}

export default Sort;
